import React from 'react'
import { Route, Navigate } from 'react-router-dom';
import Cookies from 'js-cookie';



export default function Extraxt() {
    const isLoggedIn = Cookies.get('sessionId');

    return (
        <div>
            {isLoggedIn ? (
                <h1>Welcome to spotyt</h1>
            ) : (
                <Navigate to="/login" />
            )}
        </div>
    )
}
